TypeError Cannot set property 'firstName' of null<p>I know there are similar questions posted, but I haven't been able to find a solution for my problem.</p>

<p>I am trying to create a user profile page where the user can change their information through a form that uses a POST request. However, when the value is entered in the input field, it returns null. I don't have this problem when reading the input data for authenticating a user.</p>

<p>Also, the user is found but req.body returns an empty object.</p>

<p>Tools used:</p>

<ul>
<li>Node.js v10.16.3</li>
<li>Express v4.17.1</li>
<li>ejs v2.7.1</li>
<li>Express session v1.16.2</li>
<li>Passport v^0.4.0</li>
<li>cookie-parser 1.4.4</li>
<li>body-parser v1.19.0</li>
</ul>

<p>The user that is found: </p>

<pre><code>{ _id: 5daf5ef80fb0d909e099d211,
  username: 'assa',
  email: 'easy@gmail.com',
  password:
   '$2b$05$A81bqD56TDmNoWhiHJVwR.2L7iqZBrRwYu1FEe/bp0TlkTMEUREvS',
  firstName: 'test',
  __v: 0 }
</code></pre>

<p>app.js:</p>

<pre><code>let express = require("express"),
    app = express(),
    bodyParser = require("body-parser"),
    cookieParser = require('cookie-parser'),
    session = require("express-session"),
    mongoose = require("mongoose"),
    passport = require("passport"),
    flash = require('connect-flash'),
    validator = require('express-validator'),
    LocalStrategy = require("passport-local"),
    MongoStore = require('connect-mongo')(session);

let indexRoutes = require('./routes/index');
let userRoutes = require('./routes/user');
let User = require("./models/user");

// APP CONFIGURATION
mongoose.connect("mongodb://localhost:27017/test", { useNewUrlParser: true, useUnifiedTopology: true, }).then(() =&gt; {
    console.log("Connected to MongoDB");
}).catch((error) =&gt; {
    console.log("Something is wrong...");
});

require('./config/passport');

// View engine setup
app.set("view engine", "ejs");
app.use(express.static(__dirname + "/public"));

// Initial setup
app.use(bodyParser.json());
app.use(bodyParser.urlencoded({ extended: true }));
app.use(validator());

// Session setup
app.use(cookieParser());
app.use(session({
    secret: 'somesecretforbytox',
    resave: false,
    saveUninitialized: false
}));
app.use(flash());

// Initialize passport
app.use(passport.initialize());
app.use(passport.session());

app.use(function (req, res, next) {
    res.locals.currentUser = req.user;
    res.locals.session = req.session;
    next();
});

// ======================
// Connect to route files
// ======================
app.use('/user', userRoutes);
app.use(indexRoutes);

app.listen(3033, function () {
    console.log("Listening at port 3033...");
});
</code></pre>

<p>user.js</p>

<pre><code>let express = require('express'),
    router = express.Router(),
    passport = require('passport');

let User = require("../models/user");

// user profile
router.get("/profile", isLoggedIn, function (req, res) {
    res.render("user/profile", { currentUser: req.user });
});

router.post('/profile', (req, res) =&gt; {
    updateRecord(req, res);
    res.redirect('/user/profile');
});

function updateRecord(req, res) {
    User.findOne({ 'id': req.user.id }, function (err, user) {
        let firstName = req.body.firstName;
        user.firstName = firstName;

        user.save(function (err, doc) {
            if (err) {
                return done(err);
            }
            return done(null, doc);
        });
    });
}

router.get("/profile/edit", isLoggedIn, function (req, res) {
     res.render("user/edit", { currentUser: req.user });

});

// ...sign in and signup routes

module.exports = router;

// middleware
function isLoggedIn(req, res, next) {
    if (req.isAuthenticated()) {
        return next();
    }
    res.redirect('/user/login');
}
</code></pre>

<p>profile.ejs:</p>

<pre><code>&lt;form action="/user/profile" method="POST" class="form-validate form-horizontal"&gt;
    &lt;fieldset&gt;
        &lt;legend&gt;Edit addresss&lt;/legend&gt;
        &lt;!-- email --&gt;
        &lt;div class="control-group"&gt;
            &lt;div class="control-label"&gt;
                &lt;label id="jform_email1-lbl" for="jform_email" class="hasPopover required" title="" data-content="Въведете имейл адрес." data-original-title="Email Address"&gt;
                    Email&lt;span class="star"&gt;&amp;nbsp;*&lt;/span&gt;&lt;/label&gt;
            &lt;/div&gt;
            &lt;div class="controls"&gt;
                &lt;input type="email" name="email" class="validate-email required" id="jform_email" value="&lt;%= (typeof currentUser.email != 'undefined' ? currentUser.email : '') %&gt;" size="30" autocomplete="email" required aria-required="true"&gt;
            &lt;/div&gt;
        &lt;/div&gt;
        &lt;!-- name --&gt;
        &lt;div class="control-group"&gt;
            &lt;div class="control-label"&gt;
                &lt;label id="jform_fname-lbl" for="jform_fname" class="hasPopover required" title="" data-content="Въведете име." data-original-title="Name"&gt;
                    Name&lt;span class="star"&gt;&amp;nbsp;*&lt;/span&gt;&lt;/label&gt;
            &lt;/div&gt;
            &lt;div class="controls"&gt;
                &lt;input type="text" name="firstName" id="jform_fname" value="&lt;%= (typeof currentUser.firstName != 'undefined' ? currentUser.firstName : '') %&gt;" class="required" size="30" required aria-required="true"&gt;
            &lt;/div&gt;
        &lt;/div&gt;
    &lt;/fieldset&gt;

    &lt;div class="form-actions"&gt;
        &lt;!-- &lt;input type="hidden" name="_csrf" value=" csrfToken "&gt; --&gt;
        &lt;button type="submit" class="btn btn-primary validate"&gt;
            &lt;span&gt;Save&lt;/span&gt;
        &lt;/button&gt;
        &lt;!-- &lt;input type="hidden" name="_csrf" value=" csrfToken "&gt; --&gt;
        &lt;a class="btn" href="/" title="Cancel"&gt;Cancel&lt;/a&gt;
    &lt;/div&gt;
&lt;/form&gt;
</code></pre>

<p>user schema:</p>

<pre><code>let mongoose = require('mongoose');
let Schema = mongoose.Schema;
let bcrypt = require('bcrypt');

let userSchema = new Schema({
  username: { type: String, required: true },
  email: { type: String, required: true },
  password: { type: String, required: true },
  firstName: { type: String },
  lastName: { type: String },
  address: { type: String },
  zip: { type: String },
  country: { type: String },
  phone: { type: String }
});

userSchema.methods.encryptPassword = function (password) {
  return bcrypt.hashSync(password, bcrypt.genSaltSync(5), null);
};

userSchema.methods.validPassword = function (password) {
  return bcrypt.compareSync(password, this.password);
}

module.exports = mongoose.model('user', userSchema);
</code></pre>

