<p>Essentially, in the process of adding new users to the db, I want to check one of the specified values (the "position code(s)") against a list of acceptable codes. I retrieve these acceptable position codes via an async call and then use an underscore method to compare the specified position code(s) against the acceptable ones. If any are found, I throw an error. </p>

