<p>The most recent thing i've tried is simply using the "throw new Error()" methodology since my understanding is that this should get picked up by the Express middleware. But it's not working. The error message I specify in the error object IS getting printed in the console, but in a "UnhandledPromiseRejectionWarning" error. When running this in Postman, Postman just doesn't return anything (basically appears like it's loading and then says could not get a response").</p>

<p>I also tried wrapping this in a try catch block. </p>

<p>I also tried passing the error to a next() method.</p>

<pre class="lang-js prettyprint-override"><code>router.route('/add').post(async (req, res) =&gt; {
    let
      newAdults = [],
      roleCodes = await Role.find()
        .then(roles =&gt; _.pluck(roles, "code"))
        .catch(err =&gt; res.status(400).json('Error: ' + err));

    req.body.forEach((el, id) =&gt; {

        let
          firstName = el.firstName,
          lastName = el.lastName,
          emailAddress = el.emailAddress,
          username = el.username,
          roles = el.roles;

        // one thing we need to lookout for is if an invalid role code is being used.
        // here we compare role codes associated with the new adult and all approved
        // role codes. this will identify invalid role codes

        let invalidCodes = _.difference(_.pluck(roles, "code"), roleCodes)

        if (invalidCodes.length &gt; 0)
          throw new Error(`Role code(s) ${invalidCodes} for ${firstName} ${lastName} are invalid.`)
</code></pre>

<p>Ultimately I want to just return the message I have in my error object.</p>

